import {CST} from "../CST";

export class EndLoadScene extends Phaser.Scene{
    constructor(){
        super({
            key: CST.SCENES.ENDLOAD
        })
    }
    init(data) {
        this.score = data;
        this.readyCount = 0;
    }
    
    create(){
        
        this.scene.start(CST.SCENES.ENDING, this.score);
       
    }
}
